  return (
    <View style={{ flex:1, justifyContent: "center", alignItems: "center" }}>
      <Text>
          Hello World
      </Text>
  </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
});
